import React from 'react';
import {makeStyles} from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';

const useStyles = makeStyles({
    table: {
        minWidth: 650,
    },
});

const createTableComponent = (props) => {
    const classes = useStyles();

    let tableComponent = '<Table className={classes.table} aria-label="simple table">'
    const headers = props.headers || [];
    const tableData = props.tableData || [];
    tableComponent += '<TableHead><TableRow>';
    for (const header of headers) {
        tableComponent += typeof header === "string" ? '<TableCell>{header}</TableCell>' : '<TableCell> </TableCell>';
    }
    tableComponent += '</TableRow></TableHead>';

    tableComponent += '<TableBody>';
    for (const data of tableData) {
        tableComponent += '<TableRow>';
        for (const key in data) {
            tableComponent += '<TableCell>{data[key}</TableCell>';
        }
        tableComponent += '</TableRow>';
    }
    tableComponent += '</TableBody></Table>';

    return tableComponent;
}



